  //       },
  //       (error) => {
  //         console.log(error);
  //       }
  //     );
  // }, []);

  const url = "https://api.github.com/orgs/Netflix/repos";

  const getAllRepos = () => {
    axios
      .get(`${url}`)
      .then((res) => {
        console.log(res);
        const allRepos = res.data.data;
        console.log(allRepos);
        setRepos(allRepos);
      })
      .catch((error) => console.error(`Error: ${error}`));
  };

  useEffect(() => {
    getAllRepos();
  }, []);

  return (
    <>
      <div className="section">
        <Repos />
      </div>
    </>
  );
}

export default App;
